import { BiArchive } from "react-icons/bi";
import Search from "./components/Search";

function App() {
  return (
    <div className="App container mx-auto mt-3 ">
      <div className="mx-4">
        <h1>
          <BiArchive className="inline-block align-top text-red-400 text-size-5" />
          Edit and save to reload.
        </h1>
        <Search />
      </div>
    </div>
  );
}

export default App;
